import Logo from "./logo.png";
import Account from "./account_circle.png";

export const Header = () => {
  return (
    <div>
      <div className="bg-green-500 hover:bg-green-700 text-white font-bold py-2 px-4 rounded">
        <div>
          <img src={Logo} />
        </div>
        <ul>
          <li>Главная</li>
          <li>О нас</li>
          <li>Помощь</li>
          <li>+7 495 967 13 01</li>
        </ul>
        <div>
          <div>Личный кабинет</div>
          <div>
            <img src={Account} />
          </div>
        </div>
      </div>
    </div>
  );
};
